void canvasRender() {
    // Draw the white background for the canvas for both buffers
    Position canvasPos = {CENTER_X - CANVAS_SIZE * BOX_SIZE / 2, RESOLUTION_Y * 1.0 / 7.0};

    if(canvasReady == true) {
        
        for(int y = 0; y < CANVAS_SIZE * BOX_SIZE; y++)
            for(int x = 0; x < CANVAS_SIZE * BOX_SIZE; x++)
                plot_pixel(canvasPos.x + x, canvasPos.y + y, 0xFFFF);
        
        if(canvasReadyCount >= 2) {
            canvasReady = false;
            canvasReadyCount = 0;
        } else canvasReadyCount++;
         
    }

    // If user drew in 2nd previous frame, update canvas at where it was drawn for both buffers for good measure 
    if(canvasDrawThird == true) {
        int minX = canvasDrawThirdPosition.x-1 >= 0 ? canvasDrawThirdPosition.x-1 : 0;
        int minY = canvasDrawThirdPosition.y-1 >= 0 ? canvasDrawThirdPosition.y-1 : 0;
        int maxX = canvasDrawThirdPosition.x+1 <= 27 ? canvasDrawThirdPosition.x+1 : 27;
        int maxY = canvasDrawThirdPosition.y+1 <= 27 ? canvasDrawThirdPosition.y+1 : 27;

        for(int my = minY; my < maxY+1; my++)
            for(int mx = minX; mx < maxX+1; mx++)
                for(int y = 0; y < BOX_SIZE; y++) 
                    for(int x = 0; x < BOX_SIZE; x++) {
                        short int RBcharacter = 31 - (unsigned short)(drawArray[my][mx] * 31);
                        short int Gcharacter = 63 - (unsigned short)(drawArray[my][mx] * 63);
                        short int color = RBcharacter << 11 | (Gcharacter << 5) | RBcharacter;
                        plot_pixel(canvasPos.x + mx * BOX_SIZE + x, canvasPos.y + my * BOX_SIZE + y, color);  
                    } 
        
        if(canvasDrawThirdCount >= 2) {
            canvasDrawThird = false;
        } else canvasDrawThirdCount++;
    }

    // If user drew in previous frame, update canvas at where it was drawn for both buffers for good measure 
    if(canvasDrawSecond == true) {
        int minX = canvasDrawSecondPosition.x-1 >= 0 ? canvasDrawSecondPosition.x-1 : 0;
        int minY = canvasDrawSecondPosition.y-1 >= 0 ? canvasDrawSecondPosition.y-1 : 0;
        int maxX = canvasDrawSecondPosition.x+1 <= 27 ? canvasDrawSecondPosition.x+1 : 27;
        int maxY = canvasDrawSecondPosition.y+1 <= 27 ? canvasDrawSecondPosition.y+1 : 27;

        for(int my = minY; my < maxY+1; my++)
            for(int mx = minX; mx < maxX+1; mx++)
                for(int y = 0; y < BOX_SIZE; y++) 
                    for(int x = 0; x < BOX_SIZE; x++) {
                        short int RBcharacter = 31 - (unsigned short)(drawArray[my][mx] * 31);
                        short int Gcharacter = 63 - (unsigned short)(drawArray[my][mx] * 63);
                        short int color = RBcharacter << 11 | (Gcharacter << 5) | RBcharacter;
                        plot_pixel(canvasPos.x + mx * BOX_SIZE + x, canvasPos.y + my * BOX_SIZE + y, color);  
                    } 
        
        if(canvasDrawSecondCount >= 2) {
            canvasDrawSecond = false;
        } else canvasDrawSecondCount++;

        if(canvasDrawSecondCount == 1) {
            canvasDrawThird = true;
            canvasDrawThirdCount = 0;
            canvasDrawThirdPosition.x = canvasDrawSecondPosition.x;
            canvasDrawThirdPosition.y = canvasDrawSecondPosition.y;
        }
    }
    
    // If user drew, update canvas at where it was drawn for both buffers
    if(canvasDraw == true) {
        int minX = canvasDrawPosition.x-1 >= 0 ? canvasDrawPosition.x-1 : 0;
        int minY = canvasDrawPosition.y-1 >= 0 ? canvasDrawPosition.y-1 : 0;
        int maxX = canvasDrawPosition.x+1 <= 27 ? canvasDrawPosition.x+1 : 27;
        int maxY = canvasDrawPosition.y+1 <= 27 ? canvasDrawPosition.y+1 : 27;

        for(int my = minY; my < maxY+1; my++)
            for(int mx = minX; mx < maxX+1; mx++)
                for(int y = 0; y < BOX_SIZE; y++) 
                    for(int x = 0; x < BOX_SIZE; x++) {
                        short int RBcharacter = 31 - (unsigned short)(drawArray[my][mx] * 31);
                        short int Gcharacter = 63 - (unsigned short)(drawArray[my][mx] * 63);
                        short int color = RBcharacter << 11 | (Gcharacter << 5) | RBcharacter;
                        plot_pixel(canvasPos.x + mx * BOX_SIZE + x, canvasPos.y + my * BOX_SIZE + y, color);  
                    } 
        
        if(canvasDrawCount >= 2) {
            canvasDraw = false;
        } else canvasDrawCount++;

        if(canvasDrawCount == 1)  {
            canvasDrawSecond = true;
            canvasDrawSecondCount = 0;
            canvasDrawSecondPosition.x = canvasDrawPosition.x;
            canvasDrawSecondPosition.y = canvasDrawPosition.y;
        }
    }

    // Render back button
    Size backSize = {sizeof(button) / sizeof(button[0]), sizeof(button[0]) / sizeof(button[0][0])};
    Position backPos = {CENTER_X - backSize.xSize * 3.0 / 2.0 + 2, RESOLUTION_Y * 9.0 / 11.0 - backSize.ySize / 2 + RESOLUTION_Y / CHAR_ROW / 2};
    drawComponent(backPos, backSize, button);
	
	// Render predict button
    Size predictSize = {sizeof(button) / sizeof(button[0]), sizeof(button[0]) / sizeof(button[0][0])};
    Position predictPos = {CENTER_X + predictSize.xSize * 1.0 / 2.0 - 2, RESOLUTION_Y * 9.0 / 11.0 - predictSize.ySize / 2 + RESOLUTION_Y / CHAR_ROW / 2};
    drawComponent(predictPos, predictSize, button);

	// Render back text
    char* backText = "BACK TO MENU";
    Position backTextPos = {CHAR_COL / 2 - 6 - backSize.xSize * CHAR_COL / RESOLUTION_X, CHAR_ROW * 9.0/11.0};
    writeText(backTextPos, backText);
	
	// Render predict text
    char* predictText = "RECOGNIZE IT";
    Position predictTextPos = {CHAR_COL / 2 - 6 + predictSize.xSize * CHAR_COL / RESOLUTION_X, CHAR_ROW * 9.0/11.0};
    writeText(predictTextPos, predictText);


    // Render icon of current drawing mode
    Size modeSize; 
    
    if(drawingMode == PENCIL) {
        modeSize.ySize = sizeof(pencil) / sizeof(pencil[0]);
        modeSize.xSize = sizeof(pencil[0])/sizeof(pencil[0][0]);
    } else if(drawingMode == ERASE) {
        modeSize.ySize = sizeof(eraser) / sizeof(eraser[0]);
        modeSize.xSize = sizeof(eraser[0]) / sizeof(eraser[0][0]);
    }
    
    Position modePos = {CENTER_X - modeSize.xSize / 2, RESOLUTION_Y * 9.0 / 11.0 - modeSize.ySize / 2 + RESOLUTION_Y / CHAR_ROW / 2};
    clearArea(modePos, modeSize, 0x0);
    if(drawingMode == PENCIL)
        drawComponent(modePos, modeSize, pencil);
    else if(drawingMode == ERASE) 
        drawComponent(modePos, modeSize, eraser);
}

