/***************************************************
*   Canvas Handles                                 *
****************************************************/

void drawCanvasArray() {
    // Draw the white background for the canvas
    Position canvasPos = {CENTER_X - CANVAS_SIZE * BOX_SIZE / 2, RESOLUTION_Y * 1.0 / 7.0};

    int xCoord = (mouse.x - canvasPos.x) / BOX_SIZE;
    int yCoord = (mouse.y - canvasPos.y) / BOX_SIZE;

    if(xCoord == pastXCoord && yCoord == pastYCoord)
        return;

    pastXCoord = xCoord;
    pastYCoord = yCoord;

    if (xCoord < 0 || yCoord < 0) return;
    if (xCoord > 27 || yCoord > 27) return;

    

    if (drawingMode == PENCIL) {
        drawArray[yCoord][xCoord] = 1.0;
        if (xCoord < 27) {
            drawArray[yCoord][xCoord + 1] += 0.3;
            if (drawArray[yCoord][xCoord + 1] > 1) drawArray[yCoord][xCoord + 1] = 1;
        }

        if (xCoord > 0) {
            drawArray[yCoord][xCoord - 1] += 0.3;
            if (drawArray[yCoord][xCoord - 1] > 1) drawArray[yCoord][xCoord - 1] = 1;
        }

        if (yCoord < 27) {
            drawArray[yCoord + 1][xCoord] += 0.3;
            if (drawArray[yCoord + 1][xCoord] > 1) drawArray[yCoord + 1][xCoord] = 1;
        }

        if (yCoord > 0) {
            drawArray[yCoord - 1][xCoord] += 0.3;
            if (drawArray[yCoord - 1][xCoord] > 1) drawArray[yCoord - 1][xCoord] = 1;
        }
        
        if (xCoord < 27 && yCoord < 27) {
            drawArray[yCoord + 1][xCoord + 1] += 0.1;
            if (drawArray[yCoord + 1][xCoord + 1] > 1) drawArray[yCoord + 1][xCoord + 1] = 1;
        }
        
        if (xCoord > 0 && yCoord > 0) {
            drawArray[yCoord - 1][xCoord - 1] += 0.1;
            if (drawArray[yCoord - 1][xCoord - 1] > 1) drawArray[yCoord - 1][xCoord - 1] = 1;
        }

        if (xCoord < 27 && yCoord > 0) {
            drawArray[yCoord - 1][xCoord + 1] += 0.1;
            if (drawArray[yCoord - 1][xCoord + 1] > 1) drawArray[yCoord - 1][xCoord + 1] = 1;
        }
        
        if (xCoord > 0 && yCoord < 27) {
            drawArray[yCoord + 1][xCoord - 1] += 0.1;
            if (drawArray[yCoord + 1][xCoord - 1] > 1) drawArray[yCoord + 1][xCoord - 1] = 1;
        }
    
    }

    else {
        drawArray[yCoord][xCoord] = 0.0;
        if (xCoord < 27) {
            drawArray[yCoord][xCoord + 1] -= 0.3;
            if (drawArray[yCoord][xCoord + 1] < 0) drawArray[yCoord][xCoord + 1] = 0;
        }

        if (xCoord > 0) {
            drawArray[yCoord][xCoord - 1] -= 0.3;
            if (drawArray[yCoord][xCoord - 1] < 0) drawArray[yCoord][xCoord - 1] = 0;
        }

        if (yCoord < 27) {
            drawArray[yCoord + 1][xCoord] -= 0.3;
            if (drawArray[yCoord + 1][xCoord] < 0) drawArray[yCoord + 1][xCoord] = 0;
        }

        if (yCoord > 0) {
            drawArray[yCoord - 1][xCoord] -= 0.3;
            if (drawArray[yCoord - 1][xCoord] < 0) drawArray[yCoord - 1][xCoord] = 0;
        }
        
        if (xCoord < 27 && yCoord < 27) {
            drawArray[yCoord + 1][xCoord + 1] -= 0.3;
            if (drawArray[yCoord + 1][xCoord + 1] < 0) drawArray[yCoord + 1][xCoord + 1] = 0;
        }
        
        if (xCoord > 0 && yCoord > 0) {
            drawArray[yCoord - 1][xCoord - 1] -= 0.3;
            if (drawArray[yCoord - 1][xCoord - 1] < 0) drawArray[yCoord - 1][xCoord - 1] = 0;
        }

        if (xCoord < 27 && yCoord > 0) {
            drawArray[yCoord - 1][xCoord + 1] -= 0.3;
            if (drawArray[yCoord - 1][xCoord + 1] < 0) drawArray[yCoord - 1][xCoord + 1] = 0;
        }
        
        if (xCoord > 0 && yCoord < 27) {
            drawArray[yCoord + 1][xCoord - 1] -= 0.3;
            if (drawArray[yCoord + 1][xCoord - 1] < 0) drawArray[yCoord + 1][xCoord - 1] = 0;
        }
    }

    canvasDraw = true;
    canvasDrawCount = 0;
    canvasDrawPosition.x = xCoord;
    canvasDrawPosition.y = yCoord;
        
} 

